import React, { useState, useEffect } from 'react';
import axios from 'axios';
import UserList from './UserList';

const Users = (userDTO) => {
    const [users, setUsers] = useState([]);

    useEffect(() => {
        axios.get('/auth/signin', userDTO)
            .then(response => {
                setUsers(response.data);
            });
    }, []);

    return (
        <>
            <h1>Users</h1>
            <UserList user={users}/>
        </>
    );
}

export default Users;
